import React from 'react'

const ArtWork = (props) => {
  console.log("work", props)
  const { artWork } = props
  return(
    <div>
      {
        artWork && artWork.map((artWork, index) => {
          return(
            <div className="col l6 m6 s12">
              <img src={artWork.imageUrl} alt="art" className="responsive-img"/>
            </div>
          )
        })
      }
    </div>
  )
}

export default ArtWork
